import React from "react";
import {
  Typography,
  Grid,
  List,
  ListItem,
  ListItemButton,
  ListItemText,
  IconButton,
} from "@mui/material";
import Button from "@mui/material/Button";
import FileDownloadOutlinedIcon from "@mui/icons-material/FileDownloadOutlined";

const dowonloadInfo = [
  ["ダウンロードファイル名1", "備考1"],
  ["ダウンロードファイル名2", "備考2"],
  ["ダウンロードファイル名3", "備考3"],
  ["ダウンロードファイル名4", "備考4"],
  ["ダウンロードファイル名5", "備考5"],
];
function Downloads() {
  return (
    <Grid
      id="item_8"
      className="Downloads"
      container
      direction="column"
      justifyContent="center"
      alignItems="center"
    >
      <Grid item xs={12} md={6}>
        <Typography variant="h4" align="center" mb={3}>
          各種ダウンロード
        </Typography>
      </Grid>
      <Grid item>
        {dowonloadInfo.map((item: any, _index) => {
          return (
            <ListItem disablePadding key={_index}>
              <ListItemButton
                sx={{
                  textAlign: "left",
                  borderBottom: 0.5,
                  borderColor: "#e6e6e6",
                }}
                disableRipple
              >
                <Grid
                  item
                  container
                  flexDirection="row"
                  justifyContent="space-between"
                  alignItems="center"
                  xs={12}
                  md={12}
                >
                  <Grid item flexDirection="column" xs={12} md={6}>
                    <ListItemText
                      primary={item[0]}
                      primaryTypographyProps={{
                        color: "secondary",
                      }}
                    />
                    <ListItemText
                      primary={item[1]}
                      primaryTypographyProps={{
                        color: "secondary",
                      }}
                    />
                  </Grid>
                  <Grid item xs={12} md={6}>
                    <IconButton
                      color="primary"
                      aria-label="upload picture"
                      component="label"
                    >
                      <FileDownloadOutlinedIcon />
                    </IconButton>
                  </Grid>
                </Grid>
              </ListItemButton>
            </ListItem>
          );
        })}
      </Grid>
    </Grid>
  );
}

export default Downloads;
